INSERT INTO`rain_2018_10_11` VALUES ('16012', '第九河川局', 'EMIC', '', '42017100000213', '花蓮縣', '富里鄉', '道路', '2017/10/15 下午 01:03:00', '2017-10-15 13:03:00', '花蓮縣富里鄉崙天大橋`花蓮縣富里鄉竹田村`', '崙天大橋溪堤道路與花75線附近田間道路淹水，人車通行有危險，現場兩頭已拉起封鎖線。', '50', '是', '2017/10/16 上午 02:16:00', '1.公所已於現場兩頭已拉起封鎖線。 2.目前雨勢較小，逐漸退水中。', '富里鄉公所03-8831111', '277608.720265', '2568474.51994', '121.269756', '23.218232');
