INSERT INTO`rain_2018_10_11` VALUES ('16019', '第九河川局', 'EMIC', '', '42017100000227', '花蓮縣', '花蓮市', '道路', '2017/10/15 下午 02:38:00', '2017-10-15 14:38:00', '花蓮縣花蓮市沙基拉雅街', '花蓮縣花蓮市沙基拉雅街39巷30弄45號附近淹水', '0', '是', '2017/10/16 上午 04:13:00', '花蓮市公所查證後，已退水。', '花蓮市公所-李建和 038342995', '308802.048593', '2656007.20263', '121.577983', '24.007796');
INSERT INTO`rain_2018_10_11` VALUES ('16020', '第九河川局', 'EMIC', '', '42017100000235', '花蓮縣', '吉安鄉', '道路', '2017/10/15 下午 04:06:00', '2017-10-15 16:06:00', '花蓮縣吉安鄉東昌村', '吉安鄉東昌村名人120號道路淹水，請求派員協助抽水', '--', '是', '2017/10/16 上午 05:49:00', '1.吉安鄉公所建設科科長已調派2台12\"抽水機至現場。 2.本局出動2台12\"抽水機前往支援。', '', '310800.012601', '2651332.46259', '121.597426', '23.965512');
INSERT INTO`rain_2018_10_11` VALUES ('16021', '第九河川局', 'EMIC', '', '42017100000240', '花蓮縣', '光復鄉', '道路', '2017/10/15 下午 08:52:00', '2017-10-15 20:52:00', '花蓮縣光復鄉大馬村', '光復鄉馬太鞍溪橋溪水快滿出堤防 21:18光復災害應變中心來電：堤防恐會潰堤，已在進行村民撤離動作。', '0', '是', '2017/10/15 上午 09:00:00', '本案同前16009案位置(明利村1、2鄰至馬太鞍(花45)道路積(淹)水嚴重,已於上午8時拉警戒線封路，禁止人車通行。)九河局已於15日9時起辦理緊急搶險中，目前因夜間視線不良而暫停，惟仍請開口契約廠商保留1台怪手及2名人員於現場徹夜警戒(22時回報現場無雨且馬鞍溪水位資料顯示下降中)，必要時採取相關緊急措施。村民撤離動作係由光復鄉災害應變中心處置。', '第九河川局緊急應變小組03-8360808', '292850.433249', '2619568.37839', '121.420132', '23.679282');
